import React from "react";
import "../styles/App.css";


function GameCard(props) {
  return (
    <div className="card" onClick={ () => props.handleClick(props.id)}>
      <div className="img-container">
        <img alt={['hi']} src={props.image} />
      </div>


    </div>
  );
}

export default GameCard;
